(function() {
  this.app = angular.module('app', ['ngSanitize', 'ngRoute', 'ngMessages']);

  this.app.config([
    '$routeProvider', function($routeProvider) {
      return $routeProvider.when('/addEvent', {
        templateUrl: '/angular_templates/add_event.html',
        controller: 'EventsAddCtrl'
      }).otherwise({
        templateUrl: '/angular_templates/home.html',
        controller: 'EventsListCtrl'
      });
    }
  ]);

}).call(this);
(function() {
  this.app.filter('boldWords', function() {
    return function(item) {
      var regex;
      regex = /(place[s]?)|(sc[èeëéê]ne[s]?)|(speaker[s]?)|(lieu)/gi;
      return item.replace(regex, '<b>$&</b>');
    };
  });

  this.app.filter('filterDate', function() {
    return function(item, eventStrDate) {
      var eventDate, nextWeek, today;
      today = new Date;
      nextWeek = Date.parse(new Date(today.getFullYear(), today.getMonth(), today.getDate() + 7));
      eventDate = new Date(eventStrDate);
      if (Date.parse(eventDate) <= nextWeek) {
        item = '<span class="red-text">' + item + '<i class="material-icons">warning</i></span>';
      } else {
        item = '<i class="material-icons">event</i>' + item;
      }
      return item;
    };
  });

}).call(this);
(function() {
  this.app.controller('EventsListCtrl', [
    '$scope', '$location', '$http', function($scope, $location, $http) {
      $scope.events = [];
      $scope.createEvent = function(createEvent) {
        return $location.path('/addEvent');
      };
      $http.get('./events.json').success(function(data) {
        return $scope.events = data;
      });
      $scope.columnSort = 'created_at';
      $scope.reverse = true;
      return $scope.order = function(col) {
        if (col === 'dateEvent') {
          $scope.reverse = false;
        } else if (col === 'created_at') {
          $scope.reverse = true;
        }
        return $scope.columnSort = col;
      };
    }
  ]);

  this.app.controller('EventsAddCtrl', [
    '$scope', '$location', '$http', function($scope, $location, $http) {
      $scope.emailPattern = /^.+@.+[.].{2,4}$/i;
      $scope.maxlength = 300;
      $scope.name = '';
      $scope.dateEvent = '';
      $scope.email_organizer = '';
      $scope.description = '';
      return $scope.submitForm = function() {
        var event;
        if ($scope.form.$valid) {
          event = {
            name: $scope.name,
            dateEvent: $scope.dateEvent,
            email_organizer: $scope.email_organizer,
            description: $scope.description
          };
          console.log(event);
          return $http.post('./events.json', event).success(function(data) {
            return $location.path('');
          }).error(function(data) {
            return alert("L'évennement n'a pas pu être ajouté !");
          });
        }
      };
    }
  ]);

}).call(this);
